import React, { Component } from "react";

import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";

import DataScience, {MachineLearning, BigData} from "./CourseDesc";
 
class Student extends Component {
  render() {
    return (
      <HashRouter>
      <div>
        <h1>Welcome to Courses</h1>
        <h3> List of Courses </h3>
        <li><NavLink exact to="/Student-DataScience"> Data Science</NavLink> </li>
        <li><NavLink exact to="/Student-MachineLearning">Machine Learning</NavLink> </li>
        <li><NavLink exact to="/Student-BigData">Big Data</NavLink> </li>
      
        <div className="content">
            <Route path="/Student-DataScience" component={DataScience}/>
            <Route path="/Student-MachineLearning" component={MachineLearning}/>
            <Route path="/Student-BigData" component={BigData}/>
        </div>
      </div>
      </HashRouter>
    );
  }
}
 
export default Student;
